import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import Header from './header';
import '../../App.css'
import axios from 'axios';

class Dashboard extends Component {

  state = {
    listevents: []
  }

  async componentDidMount() {
    let result = await axios.post(`https://binggo-test.dokyumento.asia/index.php/Binggo/fetch_all_binggo_events`)
    this.setState({listevents: result.data.payload})
  }


  render() {
    return (
      <>
        <Header />

        <div className="container-fluid mt-5">
          <div className="row">
            <div className="col-xl-4">
              <div className="card rounded-0">
                <h5 className="card-header text-center">List of Bingo Event</h5>
                <div className="card-body">

                  {
                    this.state.listevents.length > 0 ? (
                        <select className="custom-select rounded-0 mb-3">
                            {this.state.listevents.map(list => 
                                <option key={list.binggo_event_id} value={list.binggo_event_id} >{list.binggo_title}</option>
                            )}
                        </select>

                    ):(
                        <span></span>
                    )
                  }

                  <a href="#!" class="btn btn-primary center">Proceed</a>

                </div>
              </div>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default Dashboard;
